import { TextField } from "@mui/material";
import { Box } from "@mui/system";
import { useState } from "react";

export default function GenericInputField(props) {
  const { label, helperText, errorStatus = false } = props;

  const [inputValue, setinputValue] = useState(label);

  return (
    <Box sx={{ p: 1 }}>
      <TextField
        fullWidth
        error={errorStatus}
        id={label}
        label={label}
        variant="outlined"
        helperText={errorStatus ? helperText : ""}
        onChange={inputValue}
        value={inputValue}
      />
    </Box>
  );
}
